import React from 'react';

const Navigation = ({ onRouteChange }) => {
        return (
            <nav style={{display: 'flex', justifyContent: 'flex-end', background: 'white'}}>
                <p onClick={() => onRouteChange('category')} className='f3 link dim black underline pa3 pointer'>Category</p>
                <p onClick={() => onRouteChange('form')} className='f3 link dim black underline pa3 pointer'>Form</p>
            </nav>
    );
}

export default Navigation;
